import React, { useState } from 'react';

const Affirmations = () => {
  const [affirmation, setAffirmation] = useState('');
  const [affirmationsList, setAffirmationsList] = useState([
    'I am doing my best and that is enough.',
    'I accept my thoughts and emotions.',
    'Everyone makes mistakes. I can try again.',
    'I am unique and capable of great things.',
    'I can learn and grow every day.',
    'I can achieve my goals.',
    'I will be patient with myself.',
    'I will encourage myself.',
  ]);

  const handleSubmit = (e) => {
    e.preventDefault();
    if (affirmation.trim()) {
      setAffirmationsList([...affirmationsList, affirmation.trim()]);
      setAffirmation('');
    }
  };

  // Total cells in a 6x8 table (48 cells)
  const totalCells = 6 * 8;
  const affirmationsWithPlaceholders = [...affirmationsList, ...Array(totalCells - affirmationsList.length).fill('🌸 Add more affirmations!')];

  return (
    <div className="min-h-screen bg-gradient-to-b from-pink-100 to-pink-200 p-6 font-nunito">
      <h1 className="text-4xl font-sacramento text-pink-600 text-center mb-8 animate-pulse">🌸 My Affirmations Board 🌸</h1>

      {/* Add Affirmation Form */}
      <div className="max-w-2xl mx-auto mb-8">
        <form onSubmit={handleSubmit} className="flex space-x-4">
          <input
            type="text"
            value={affirmation}
            onChange={(e) => setAffirmation(e.target.value)}
            placeholder="Add your affirmation..."
            className="flex-1 p-3 rounded-full border-2 border-pink-300 focus:outline-none focus:ring-2 focus:ring-pink-400 text-pink-800 placeholder-pink-400 transition-all duration-300 ease-in-out"
          />
          <button
            type="submit"
            className="bg-gradient-to-r from-pink-300 to-pink-400 text-white font-bold py-3 px-6 rounded-full shadow-md hover:bg-pink-500 hover:scale-110 transition-all duration-300 ease-in-out"
          >
            ✨ Add 🌸
          </button>
        </form>
      </div>

      {/* Affirmations Table */}
      <div className="max-w-3xl mx-auto overflow-x-auto">
        <table className="w-full table-fixed border-collapse">
          <tbody>
            {[...Array(6)].map((_, rowIndex) => (
              <tr key={rowIndex} className="border-b border-pink-200">
                {[...Array(8)].map((_, colIndex) => {
                  const index = rowIndex * 8 + colIndex;
                  return (
                    <td
                      key={colIndex}
                      className="p-2 align-middle"
                      style={{ width: '12.5%' }} // Equal width for 8 columns (100% / 8)
                    >
                      {index < affirmationsList.length ? (
                        <div
                          className="bg-opacity-90 p-4 rounded-lg shadow-md hover:shadow-lg hover:scale-105 transition-all duration-300 ease-in-out text-center h-32 w-32 flex items-center justify-center mx-auto"
                          style={{
                            backgroundColor: ['#A8B5C7', '#D4A5A5', '#E8C4B0', '#B7D7D8', '#C9A7A4', '#B0C4DE', '#D8BFD8', '#F0E68C'][index % 8],
                          }}
                        >
                          <div className="flex flex-col items-center">
                            {index % 8 === 0 && <span role="img" aria-label="sun" className="text-2xl mb-2">☀️</span>}
                            {index % 8 === 1 && <span role="img" aria-label="rainbow" className="text-2xl mb-2">🌈</span>}
                            {index % 8 === 2 && <span role="img" aria-label="heart" className="text-2xl mb-2">❤️</span>}
                            {index % 8 === 3 && <span role="img" aria-label="moon" className="text-2xl mb-2">🌙</span>}
                            {index % 8 === 4 && <span role="img" aria-label="flower" className="text-2xl mb-2">🌸</span>}
                            {index % 8 === 5 && <span role="img" aria-label="tree" className="text-2xl mb-2">🌳</span>}
                            {index % 8 === 6 && <span role="img" aria-label="leaf" className="text-2xl mb-2">🍂</span>}
                            {index % 8 === 7 && <span role="img" aria-label="rainbow" className="text-2xl mb-2">🌈</span>}
                            <p className="text-pink-800 font-semibold text-sm break-words">{affirmationsList[index]}</p>
                          </div>
                        </div>
                      ) : index < totalCells ? (
                        <div
                          className="bg-opacity-90 p-4 rounded-lg shadow-md text-center h-32 w-32 flex items-center justify-center mx-auto"
                          style={{ backgroundColor: ['#A8B5C7', '#D4A5A5', '#E8C4B0', '#B7D7D8', '#C9A7A4', '#B0C4DE', '#D8BFD8', '#F0E68C'][index % 8] }}
                        >
                          <p className="text-pink-600 font-semibold text-sm">🌸 Add more affirmations!</p>
                        </div>
                      ) : null}
                    </td>
                  );
                })}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Affirmations;
